deck_description:
i like how everyone is still pissed at Jobe for always naming his DM decks competitive lol

&nbsp;

before i get into anything what i mean by Semi-competitive is the way i will use it. my friends and i like to build old archetype based decks with meta-ish staples. with these decks we make we play a mini-tourny. The winner gets $30 USA dollars. the label is not at all meant to mean it can compete with the meta.

this is like the other red-eyes deck i published. you hope to start with fusion and a few handtraps. go meteor for moderate damage. this deck primarily bases around filling up the board with defenseless beatsticks that are easily summoned. overrun the opponent with all the big mansters. that simple.

